  \"2016-07-27T22:56:31.121022\",\n\t\"name\": \"developing-seasonal-spectral-signature-models-to-accurately-assess-indicators-of-aquatic-h-92862\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Aquatic health is the number one issue
  to be addressed in the Malheur National Wildlife Refuge Comprehensive Conservation
  Plan. Malheur Lake is the number one priority area to address aquatic health.  Therefore,
  baseline data are needed to track changes in aquatic health or determine success
  of future management actions.   The purpose of this study is to develop models that
  correlate remotely sensed data to aquatic health.  Pigments from chlorophyll a and
  various algal species impact the spectral signature of water bodies captured in
  remote imagery, such as   LANDSAT and MODIS images.   Technology has advanced such
  that the water quality parameters can be evaluated using a field validation technique.
  \ ARC GIS is used to construct a model, correlating spectral signature to aquatic
  health. Once the model is developed, past and future images can be evaluated spectrally
  to deduce the state of aquatic health over time.  The new tool then can be used
  to establish aquatic health baseline, track trend, and determine success of management
  actions. Furthermore, this technique can be applied across this Refuge and the methodology
  can be used by others trying to evaluate water quality.\",\n\t\"license_title\":
